import React from "react";
import Navbar from "../home/Navbar"; // Navbar bileşenini içe aktar
import "./Profile.css"; // Profile.css dosyasını içe aktar

function Profile() {
    const handleLogout = () => {
        window.location.href = 'http://localhost:3000/login';
    };
    
    return (
        <div className="profile-page">
            <Navbar /> {/* Navbar bileşenini ekle */}
            
            <div className="card-container">
                <div className="card card-1">
                    <h2>Berk Güven</h2>
                    <div className="profile-divider"></div>
            
                    <div className="user-info">          
                        <div className="user-photo">
                            <img src={`${process.env.PUBLIC_URL}/defaultpp.png`} alt="User" style={{ width: '175px', height: '175px' }} />
                        </div>
                        {/* Diğer kullanıcı bilgileri */}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Profile;
